script: |
  super -f text -I q1966.spq | sort > q1966.out

inputs:
  - name: q1966.spq
    data: |
      SELECT ALL - ( - - col2 ) / col0 * + col1 AS col2, + col2 * + + CAST ( NULL AS INTEGER ) FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - + col1 AND - col2;
  - name: tab0

outputs:
  - name: q1966.out
    data: |
